script: |
  super -f text -I q3802.spq | sort > q3802.out

inputs:
  - name: q3802.spq
    data: |
      SELECT DISTINCT + col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN + cor0.col0 * col2 * + col0 + + col0 + col1 AND NULL;
  - name: tab0

outputs:
  - name: q3802.out
    data: |
